import React from "react";
import "./Header.css";
import "./HorizontalneListe";
import HorizontalnaLista from "./HorizontalneListe";
import LargeButton from "./LargeButton";

function Header()
{
    return(
        <header>
            <div className="tekst">
                <HorizontalnaLista
                    prvi={<LargeButton value="#TECH"/>}
                    drugi={<LargeButton value="TEAM"/>}
                    treci={<LargeButton value="CONTACT"/>}
                    cetvrti={<LargeButton value="FVF"/>}
                />
            </div>
            <div className="ikone">
                <HorizontalnaLista
                    prvi={<LargeButton value="#TECH"/>}
                    drugi={<LargeButton value="TEAM"/>}
                    treci={<LargeButton value="CONTACT"/>}
                    cetvrti={<LargeButton value="FVF"/>}
                />
            </div>
        </header>
    );
}

export default Header;
